import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 12, height: 12, viewBox: "0 0 12 12", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M11 6a.5.5 0 00-.5-.5H6.7l1.15-1.15a.5.5 0 10-.7-.7l-2 2a.5.5 0 000 .7l2 2a.5.5 0 10.7-.7L6.71 6.5h3.79A.5.5 0 0011 6zM1 6a1.5 1.5 0 113 0 1.5 1.5 0 01-3 0z", fill: primaryFill }));
};
const ArrowStepInLeft12Filled = wrapIcon(rawSvg({}), 'ArrowStepInLeft12Filled');
export default ArrowStepInLeft12Filled;
